 subscriber.next(conversionResult instanceof Promise ? from(conversionResult) : of(conversionResult));
 }).pipe(
 mergeAll(),
 catchError((err) => {
 logger.error('Error on converting incoming uwp-text dataBus message', original, err);
 return of(undefined);
