- `transform-style: preserve-3d;` - This tells the browser to treat this element as a 3D object instead of flattened on the screen.
- `transform: translateZ(5px);` - This moves the element slightly forward along the Z axis (perpendicular to the screen). You may need to adjust this value to suit your design needs.

