```matlab
function uniqueWords = findUniqueWords(text1File, text2File)
    % Read text1 and text2 into memory-mapped files
    mmapOptions = 'r';
    mmapSize = max(30 * (stat(text1File).size / 512), stat(text2File).size);
    mmaps = {mmap(text1File, mmapSize, mmapOptions), mmap(text2File, mmapSize, mmapOptions)};

    % Convert text to lowercase and split into words
    function [words, ~] = readMmap(mmap)
        text = mmap(:);
        words = strsplit(lower(text), ' ', 'Delimiter', ' ');
        % Reset pointer to beginning of mmap
        fseek(mmap.fid, 1, 'bof')
    end

    [words1, ~] = readMmap(mmaps{1});
    [words2, ~] = readMmap(mmaps{2});

    % Find unique words in text1 that do not appear in text2
    uniqueWords = setdiff(unique(words1), unique(words2));
end

% Example usage
