```python
import boto3
from botocore.exceptions import ClientError
from PIL import Image

s3 = boto3.resource('s3')

def lambda_handler(event, context):
    bucket = event['Records'][0]['s3']['bucket']['name']
    key = event['Records'][0]['s3']['object']['key']

    try:
        image = Image.open(BytesIO(s3.Object(bucket, key).get()['Body'].read()))
        width, height = image.size

        new_width = int(min(width, height) * 0.5)
        new_height = int(new_width * (height / width))

        resized_image = image.resize((new_width, new_height), Image.ANTIALIAS)
        s3.Object(bucket, f'resized_{key}').put(Body=bytes(resized_image.save(BytesIO())))

        return {
            'statusCode': 200,
            'body': json.dumps({'message': f'Resized image {key}'})
        }
    except Exception as e:
        raise ClientError({
            'Error': {
                'Code': 'InvalidRequest',
                'Message': str(e)
            }
        })
```

This lambda function first retrieves the object from the original `bucket`. It then opens the file using the `PIL` library, gets the dimensions of the image, and calculates the new width and height based on the aspect ratio. Next, it creates a new resized image using `PIL` and saves it back to S3 in a new format. Finally, it returns a JSON response containing a message indicating the success of the operation.

