Here's a JavaScript function that takes a string variable in dot notation and returns all objects from an array of objects where a specific nested key has a matching value:

```javascript
function findObjectsByNestedKey(array, keyPath, value) {
  return array.filter(obj => {
    const parts = keyPath.split('.');
    let objToCheck = obj;
    for (let I = 0; I < parts.length - 1; i++) {
      objToCheck = objToCheck[parts[i]];
      if (typeof objToCheck !== 'object') {
        return false;
      }
    }
    const lastKey = parts[parts.length - 1];
    const lastValue = objToCheck[lastKey];
    return lastValue === value;
  });
}

