It's possible that the server's use of `Access-Control-Allow-Origin: *` (which allows cross-origin requests from any origin) is causing your issue. When making a preflight request (an OPTIONS request sent by the browser before sending the actual request), some browsers may not include the `Authorization` header if they detect that `Access-Control-Allow-Origin` is set to `*`. This is done as a security measure to prevent unauthorized access to protected resources.

