  res.header('Access-Control-Allow-Methods', 'GET, POST, PUT, DELETE, OPTIONS');
  res.header('Access-Control-Allow-Origin', '*');
  next();
});

// ...
```

In this example, we're setting `Access-Control-Allow-Credentials` to `true`, `Access-Control-Allow-Headers` to `Authorization`, and `Access-Control-Allow-Methods` to the HTTP methods allowed for CORS. We're still allowing requests from any origin (`*`) for simplicity, but you could replace `*` with a specific domain or pattern instead.

