Here's the JavaScript function you can use to sort an array of integers in ascending order:

```javascript
function sortAsc(arr) {
  return arr.sort((a, b) => {
    return a - b;
  });
}

console.log(sortAsc([3, 7, 2, 1, 6])); // [1, 2, 3, 6, 7]
```

In this implementation, we define a new function `sortAsc` that takes an array `arr` as its argument. Inside the function, we create a new arrow function (an anonymous function with a shorthand syntax) and pass it to the built-in `sort()` method of arrays. This arrow function is used to compare two elements `a` and `b` during the sorting process. If `a` is less than `b`, then it returns a negative number, indicating that `a` should come before `b`. If both `a` and `b` are equal, then it returns zero, which means they will remain in their original positions. The `sort()` method sorts the array using this comparison function until all elements are in the correct order. In our case, since we want to sort in ascending order, we subtract `a` from `b`. If `a` is less than `b`, then the difference will be a negative number, which is returned. Otherwise, if `a` is greater than or equal to `b`, then the difference will be a non-negative number, which is not returned because we only care about the sign of the result. This implementation has a time complexity of O(n log n), where n is the length of the input array.

